In C++, `std::floor()` is a mathematical function that returns the largest integer value not greater than the given number.

It is defined in the `<cmath>` library and takes one argument of type `double`, which can be any numerical value (int, float, or double).

Here's an example usage:

```c++
#include <iostream>
#include <cmath>

int main() {
    double num1 = 4.9;
    double num2 = -3.7;

    // calculate floor
    double floor_num1 = std::floor(num1);
    double floor_num2 = std::floor(num2);

    // display the results
    std::cout << "Floor of " << num1 << " = " << floor_num1 << std::endl;
    std::cout << "Floor of " << num2 << " = " << floor_num2 << std::endl;

    return 0;
}
```

Output:

```
Floor of 4.9 = 4
Floor of -3.7 = -4
```

As you can see, `std::floor()` simply rounds down to the nearest whole number.

Note that if you want to round up instead, you can use `std::ceil()`. If you want to round to the nearest integer (up or down), you can use `std::round()`. 

