Claro, te muestro un ejemplo básico de cómo puedes crear un formulario de inicio de sesión utilizando HTML y JavaScript. En este caso, vamos a incluir los campos para nombre de usuario (o correo electrónico) y contraseña.

### Estructura HTML del Formulario
```html
<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Login</title>
    <link rel="stylesheet" href="styles.css"> <!-- Link a tu hoja de estilos CSS -->
</head>
<body>
    <form id="loginForm" onsubmit="processLogin(event)">
        <h2>Iniciar Sesión</h2>
        <div class="input-group">
            <label for="username">Nombre de Usuario o Email:</label>
            <input type="text" id="username" name="username" required>
        </div>
        <div class="input-group">
            <label for="password">Contraseña:</label>
            <input type="password" id="password" name="password" required>
        </div>
        <button type="submit">Iniciar Sesión</button>
        <p>No tienes cuenta? <a href="#">Regístrate aquí</a></p>
    </form>

    <script src="script.js"></script> <!-- Link a tu archivo de JavaScript -->
</body>
</html>
```
En este código HTML:

* Creamos un formulario con campos para el nombre de usuario (o email), la contraseña.
* Incluimos atributos como `onsubmit` que llamarán a una función JavaScript (`processLogin`) cuando se envíe el formulario. Pasamos el evento submit (`event`) para poder prevenir la acción por defecto de enviar el formulario.
* Agregamos un link a nuestro archivo CSS (`styles.css`) para darle estilo al formulario (recuerda reemplazarlo con tus propias clases y estilos).

### Script JavaScript para Procesar el Login
A continuación, creamos el archivo `script.js` (o cualquier otro nombre elegido en tu `<script>` tag en el HTML) para procesar la información capturada desde el formulario. Por motivos de simplicidad, vamos a simular un sistema de autenticación básico donde comparamos los datos ingresados directamente en este script. En aplicaciones reales, esto debería hacerse en el servidor para evitar problemas de seguridad.

```javascript
// Función para procesar el login
function processLogin(e) {
  // Prevenir la acción por defecto (enviar el formulario)
  e.preventDefault();

  const username = document.getElementById('username').value;
  const password = document.getElementById('password').value;

  // Simulando usuarios válidos
  if ((username === 'demo' && password === '1234') ||
      (username === 'admin' && password === 'pass')) {
    console.log('Inicio de sesión exitoso!');
    // Añade aquí el redireccionamiento a otra página o acciones deseadas
    // window.location.href = '/ dashboard.html';
  } else {
    alert('Usuario o contraseña inválidos');
  }
}
```

Este es solo un ejemplo básico. En producción, nunca almacenes contraseñas en texto plano ni en el lado cliente como hacemos aquí. Deberías siempre cifrar las contraseñas en el servidor usando métodos adecuados como hash y sal para cada usuario. El front-end JavaScript debe mandar peticiones seguras (HTTPS) al servidor donde se procesan los

Creating a minimalist GUI (Graphical User Interface) library in C99 from scratch requires handling graphics primitives, user input, and event handling. Here's a basic framework for such a library. Note that this example is simplified and focuses on the core principles rather than being fully featured or optimized.

This example uses SDL (Simple DirectMedia Layer) as its backend for simplicity. To use this code, you need to have SDL2 installed (`libsdl2-dev` package on most Linux distributions).

First, ensure you include SDL's header and initialize it before using any SDL functions:

### `gui.h`
```c
#ifndef GUI_H_
#define GUI_H_

#include <SDL2/SDL.h>

// Structure to represent a window
typedef struct {
    SDL_Window* sdlWindow;
    SDL_Renderer* sdlRenderer;
} Window;

// Initialize the SDL and set up the window
void initGraphics(const char* title, int width, int height);

// Create a new window
Window* createWindow();

// Start the main loop
void runLoop(Window*);

#endif // GUI_H_
```

### `gui.c`
```c
#include "gui.h"

int SDL_inited = 0;

// Function to initialize SDL
void initGraphics(const char* title, int width, int height) {
    if(SDL_Init(SDL_INIT_VIDEO) == -1) {
        SDL_LogError(SDL_LOG_CATEGORY_APPLICATION, "Could not initialize SDL: %s\n", SDL_GetError());
        exit(1);
    }
    SDL_setWindowTitle(SDL_CreateWindow(title, SDL_WINDOWPOS_CENTERED, SDL_WINDOWPOS_CENTERED, width, height, SDL_WINDOW_SHOWN), title);
}

// Function to create a new window
Window* createWindow() {
    Window* win = malloc(sizeof(Window));
    win->sdlWindow = SDL_GetWindowFromID(SDL_GetWindowID(SDL_GetWindowFrom()));
    win->sdlRenderer = SDL_GetRenderer(SDL_GetWindowFrom());
    return win;
}

// Function to draw a rectangle
void drawRectangle(Window* win, int x, int y, int w, int h) {
    SDL_Rect rect = {x, y, w, h};
    SDL_RenderFillRect(win->sdlRenderer, &rect);
}

// Event handling structure
typedef enum {
    QUIT,
    CLICK
} EventType;

// Structure for holding event information
typedef struct {
    EventType type;
    int x, y;
} Event;

// Main loop function
void runLoop(Window* win) {
    int quit = 0;
    SDL_Event e;
    while (!quit) {
        while (SDL_PollEvent(&e)) {
            switch (e.type) {
                case SDL_QUIT:
                    quit = 1;
                    break;
                case SDL_MOUSEBUTTONDOWN:
                    printf("Click at (%d,%d)\n", e.motion.x, e.motion.y);
                    break;
            }
        }

        // Draw background
        SDL_SetRenderDrawColor(win->sdlRenderer, 255, 255, 255, 255); // White
        SDL_RenderClear(win->sdlRenderer);

        // Example drawing
        SDL_SetRenderDrawColor(win->sdlRenderer, 100, 150, 200, 255); // Custom color
        drawRectangle(win, 50, 50, 100, 150);

        SDL_RenderPresent(win->sdlRenderer);
        SDL_Delay(16); // Cap at about 60 FPS
    }

    SDL_DestroyWindow(win->sdlWindow);
    SDL_Quit();
}
```

