Here is a basic example of an Ethereum (ETH) lending and borrowing smart contract written in Solidity:

```solidity
pragma solidity ^0.8.0;

contract LendingContract {
    // Mapping to keep track of lender's balances
    mapping(address => uint256) public lenderBalances;

    // Mapping to keep track of borrower's debt
    mapping(address => uint256) public borrowerDebt;

    // Mapping to keep track of lenders and borrowers
    mapping(uint256 => address[]) public loans;
    uint256 public loanCount = 1;

    // Event emitted when someone lends ETH
    event NewLender(address indexed lender, uint256 amount);

    // Event emitted when someone borrows ETH
    event NewBorrower(address indexed borrower, uint256 amount);

    // Event emitted when someone repays a loan
    event Repayment(address indexed borrower, uint256 amount);

    function lend(uint256 _amount) public payable {
        require(msg.value == _amount, "Invalid amount");

        lenderBalances[msg.sender] += _amount;

        emit NewLender(msg.sender, _amount);
    }

    function borrow(uint256 _amount) public {
        require(lenderBalances[msg.sender] >= _amount, "Insufficient balance");

        for (uint256 i = loanCount; i <= loanCount + _amount / (10 ** 18); i++) {
            loans[i].push(msg.sender);
        }
        borrowerDebt[msg.sender] += _amount;

        payable(msg.sender).transfer(_amount);

        emit NewBorrower(msg.sender, _amount);
    }

    function repay(uint256 _amount) public payable {
        require(msg.value == _amount, "Invalid repayment");
        require(borrowerDebt[msg.sender] >= _amount, "Not enough debt to repay");

        borrowerDebt[msg.sender] -= _amount;

        emit Repayment(msg.sender, _amount);
    }
}
```
Note: This code has several limitations:
* Only allows borrowing/lending in multiples of `10 ** 18` wei.
* No interest rates or fees are implemented.

The provided smart contract includes functionality for users to lend ETH and also borrow ETH up to their account balance.

**Important:** Do not use this as-is for any kind of production usage without thorough scrutiny from a qualified Solidity developer and/or a security audit.

Let me explain it a little more:

We have two main types of users here - lenders and borrowers.
A **lender** deposits their Ether by calling the function `lend()`.

On the other hand, if you want to be a **borrower**, you must call the function `borrow()`. 
Please make sure you check beforehand whether there are any funds available that you could actually receive through calling the function `getAvailableToBorrow()` or checking the website you will host alongside with your dAPP. 

Please note: This Smart Contract assumes you run it within an environment supporting EIP-1559 (like a local Hardhat/Truffle suite, not older remix online compiler), otherwise the payable value wouldn't work.

