In Vue 3 and Nuxt 3, you can set a default value for a prop by using the `withDefaults` compositor provided by Vue.

Here's an example:
```javascript
// MyComponent.vue
export default {
  props: {
    greeting: String
  },
  setup(props) {
    //...
  }
}
```
To set a default value for the `greeting` prop, you would wrap the `props` object with `withDefaults` like so:

```javascript
// MyComponent.vue (with defaults)
import { defineProps, withDefaults } from 'vue'

const Props = defineProps({
  /**
   * The greeting to display.
   */
  greeting: String
})

const defaultGreeting = "Hello"

export default {
  props: withDefaults(Props, {
    greeting: defaultGreeting
  })
}
```

However, there is more concise way using `defineProps`, which is new syntax added to Vue3 for type inference, in conjunction with JavaScript defaults.

```javascript
// MyComponent.vue 
export default {
 props: {
   greeting: {
     type: String,
     default: 'Hello',
   },
 },
};
```
