```cpp
#include <iostream>
using namespace std;

// Function to calculate the surface area and volume of a cube
pair<double, double> CubeProperties(double sideLength) {
    // Calculate the surface area (6a^2) 
    double surfaceArea = 6 * pow(sideLength, 2);

    // Calculate the volume (a^3)
    double volume = pow(sideLength, 3);

    return make_pair(surfaceArea, volume);
}

int main() {
    // Input the length of a side
    cout << "Enter length of a side: ";
    double sideLength;
    cin >> sideLength;

    pair<double, double> properties = CubeProperties(sideLength);

    // Outputs
    cout << endl;
    cout << "The Surface Area is    : "
         << properties.first << endl;
    cout << "The Volume     is      : "
         << properties.second << endl;

    return 0;
}
```

### Explanation:

1. First, you need to include input output library iostream
2. Define `CubeProperties` function with two variables that returns both SurfaceArea and volume
3. Write formulas for calculating Surfacearea  and  volume
4. In Main function, Get user Input for length.
5. then use that side value as an argument for function `properties`
6. Then print results using pair values 

Please note the input provided must be numeric other wise the program will terminate 

